import React, {Component} from 'react';
import NavItem from "./NavItem";

const navItems = ["home", "back", "account", "logout"]

class Navbar extends Component {
    render() {
        return (
            <>
            <NavItem content={navItems.map(e => e)} />
            </>
        )
    }
}
export default Navbar;
